Melancholy and funny by turns, Life is Sweet is an intimate portrait of a
working-class family in a suburb just north of London; an irrepressible
mum and dad and their night-and-day twins, a bookish good girl and
a troubled, ill-tempered layabout.
Leigh and his typically brilliant cast create, with extraordinary sensitivity
and craft, a vivid, lived-in story of ordinary existence, in which even
modest dreams carry enormous weight.

